import React from "react";
import "../notices.css";
import Header from "../../../components/header/header.js";
import Footer from "../../../components/footer/footer.js";

const Noticia1 = () => {

    return (
        <>
            <div><Header /></div>
            <div >
                <h2 className="menu">Men√∫ de Noticias</h2>
                
            </div>
            <div class="rss-notices"></div>
            <div ><Footer /></div>
        </>
    );
};

export default Noticia1                                                                                               ;
